import axiosInstance from './axiosInstance';

export const pingTest = async () => {
  try {
    const response = await axiosInstance.get('/api/v1/ping');
    console.log('Ping response:', response.data);
  } catch (error) {
    console.error('Ping error:', error);
  }
};
